import "./App.css";
import Header from "./components/Header";
import NavBar from "./components/NavBar";

const App = () => {
  return (
    <div className="app_wrapper">
     <Header/>
      <NavBar/>
      <div className="content">
        <div>
          <img src="https://lh3.googleusercontent.com/proxy/xNTdLi23HRyfzLiYF3XTceR0-_8PCmGCfWcWzbKk0hbTU7jc0w8bEopsYrr-xpKtS0rGuJ5LCfhRRXw8_DnfRo7qe0yW" />
        </div>
        <div>
          ava + descriptions
        </div>
        <div>
          My posts
          <div>
            New post
          </div>
          <div>post 1</div>
          <div>post 2</div>
        </div>
      </div>
    </div>
  );
};

export default App;
